import React, { Component } from 'react';
import logo from '../../logo.svg';
import './Header.css';

export default class Header extends Component {
    constructor() {
        super();
        this.state = {
            red: true,
            tile1: "red"
        };
    }

    render() {
        return (
            <div className="nav-wrap">
                <a href="" className="logo">Logo/Brand</a>
                <nav className="nav">
                    <ul>
                        <li>bOne</li>
                        <li>bTwo</li>
                        <li>bThree</li>
                        <li>bFour</li>         
                    </ul>
                </nav>
            </div>
        );
    }
}
